import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product "Add to Cart" button to appear
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });

    // Rapid Cart Manipulation Stress Test
    // We'll add/remove the first product in the grid 10 times rapidly

    // Find all add-to-cart buttons
    const addToCartButtons = await page.$$('.add-to-cart');
    if (addToCartButtons.length === 0) throw new Error('No add-to-cart buttons found');

    // Click the first product's add-to-cart button 5 times rapidly
    for (let i = 0; i < 5; i++) {
      await addToCartButtons[0].click();
    }

    // Wait for notification to disappear (if any)
    await page.waitForTimeout(500);

    // Open cart (look for .cart or text "Cart")
    const cartSelector = '.cart';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartItems', { timeout: 5000 });

    // Take screenshot after adding
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_after_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_after_adds.png'));

    // Extract cart item quantity
    const cartItemQtySelector = '.cart-item-quantity .quantity';
    await page.waitForSelector(cartItemQtySelector, { timeout: 5000 });
    let quantityText = await page.$eval(cartItemQtySelector, el => el.textContent.trim());
    let quantityAfterAdd = parseInt(quantityText, 10);

    // Now rapidly remove items by clicking "-" button 5 times
    const minusBtnSelector = '.cart-item-quantity .quantity-btn:first-child';
    for (let i = 0; i < 5; i++) {
      await page.click(minusBtnSelector);
      // Wait a bit for UI update
      await page.waitForTimeout(150);
    }

    // Take screenshot after removals
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_after_removals.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_after_removals.png'));

    // Try to extract final cart state
    let cartEmpty = false;
    let quantityAfterRemove = 0;
    try {
      // If cart is empty, .empty-cart appears, else get quantity
      await page.waitForSelector('.empty-cart', { timeout: 1500 });
      cartEmpty = true;
    } catch {
      // Not empty, get quantity
      try {
        quantityText = await page.$eval(cartItemQtySelector, el => el.textContent.trim());
        quantityAfterRemove = parseInt(quantityText, 10);
      } catch {
        quantityAfterRemove = 0;
      }
    }

    // Extract cart counter from header
    let cartCounter = 0;
    try {
      await page.waitForSelector('#cartCount', { timeout: 2000 });
      const cartCounterText = await page.$eval('#cartCount', el => el.textContent.trim());
      cartCounter = parseInt(cartCounterText, 10);
    } catch {
      cartCounter = null;
    }

    return {
      success: true,
      action: "Performed rapid add/remove to cart and verified cart state updates",
      extractedData: {
        quantityAfterAdd,
        quantityAfterRemove,
        cartEmpty,
        cartCounter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
